import Footer from "../../components/footer/Footer";
import Header from "../../components/header/Header";
import Nav from "../../components/nav/Nav";
import "./home.css";

const Home = () => {
    return (
        <div>
            <Nav />
            <div className="homewrapper">
             <Header />
                <div className="homeContainer">
                
                홈 컨텐츠</div>
            </div>
            <Footer />
        </div>
    );
};

export default Home;
